let g = ggbApplet;
let game = {
    frame: 0,
    maxFrames: 20,
    frameTime: 140,
    position: {
        duck: 1,
        fox: 1,
        beans: 1
    },
    farmer: {
        start: { x: 2.74, y: -4.81 },
        end: { x: 4.44, y: -3.01 },
        margin: 1
    },
    over: false,
    animating: false
}

function ggbOnInit() {}

function updateVisibility() {
    for (let i = 1; i <= 3; i++) {
        g.setVisible("Duck" + i, game.position.duck === i);
        g.setVisible("Fox" + i, game.position.fox === i);
        g.setVisible("Beans" + i, game.position.beans === i);
    }
}

function updateFrame() {
    game.frame = Number(!game.frame);
    g.setValue("frame", game.frame);
}

function changeMargin() {
    if (game.over || game.animating) return;
    if (game.farmer.margin === 3) {
        game.farmer.margin = 1;
        animateBoat(game.farmer.end, game.farmer.start);
    } else {
        game.farmer.margin = 3;
        animateBoat(game.farmer.start, game.farmer.end);
    }
    wavesAudio.play();
}

function animateBoat(from, to) {
    let iteration = 1;
    let callback = () => {
        let percentage = iteration / game.maxFrames;

        g.setValue("boatX", from.x + (to.x - from.x) * percentage);
        g.setValue("boatY", from.y + (to.y - from.y) * percentage);

        if (iteration % 2) updateFrame();
        if (iteration < game.maxFrames) setTimeout(callback, game.frameTime);
        else check();

        iteration++;
    }
    game.animating = true;
    callback();
}

function addToBoat(thingToAdd) {
    if (game.over || game.animating) return;
    if (game.position[thingToAdd] !== game.farmer.margin || Object.keys(game.position).find(value => game.position[value] === 2)) return;
    game.position[thingToAdd] = 2;
    updateVisibility();
}

function removeFromBoat() {
    if (game.over || game.animating) return;
    let thingToRemove = Object.keys(game.position).find(value => game.position[value] === 2);
    if (thingToRemove) {
        game.position[thingToRemove] = game.farmer.margin;
        updateVisibility();
        check();
    }
}

function check() {
    game.animating = false;

    let { duck, fox, beans } = game.position;
    let { margin } = game.farmer;
    
    /* 
        0 = "Parabéns!",
        1 = "A raposa comeu o ganso!",
        2 = "O ganso comeu o feijão!"
    */

    if (duck === 3 && fox === 3 && beans === 3) return endGame(0);
    if (duck === fox && duck !== margin) return endGame(1);
    if (duck === beans && duck !== margin) return endGame(2);
}

function endGame(messageId) { 
    if (messageId === 1) {
        g.setVisible("Duck" + game.position.duck, false);
        g.setVisible("Fox" + game.position.fox, false);
        g.setVisible("Fox" + game.position.fox + "Fat", true);
        swallowingAudio.play();
    } else if (messageId === 2) {
        g.setVisible("Beans" + game.position.beans, false);
        g.setVisible("Beans" + game.position.beans + "Empty", true);
        eatingAudio.play();
    }
    g.setValue("ok", messageId);
    game.over = true;
}

function restart() {
    g.setValue("ok", undefined);
    game.position = { duck: 1, fox: 1, beans: 1 };
    game.farmer.margin = 1;
    game.over = false;
    g.setValue("boatX", game.farmer.start.x);
    g.setValue("boatY", game.farmer.start.y);
    g.setVisible("Fox1Fat", false);
    g.setVisible("Fox3Fat", false);
    g.setVisible("Beans1Empty", false);
    g.setVisible("Beans3Empty", false);
    updateVisibility(); 
}

let swallowingAudio = new Audio("data:audio/mpeg;base64,");
let wavesAudio = new Audio("data:audio/mpeg;base64,");
let eatingAudio = new Audio("data:audio/mpeg;base64,");